import React, { Component } from "react";
import Project from "./project";

class Projects extends Component {
  state = {
    projectList: [
      {
        uid: "0",
        shortname: "salespath"
      },
      {
        uid: "1",
        shortname: "grubhub"
      },
      {
        uid: "2",
        shortname: "gospace"
      }
    ]
  };
  render() {
    return <Project projects={this.state.projectList} />;
  }

  getAllUsersAsync = () => dispatch =>
    axios
      .get(PEOPLE_API_PATH)
      .then(response => {
        dispatch(addUsers(response.data));
      })
      .catch(error => {
        dispatch(showMessage(`${FAILED_TO_LOAD_USERS}: ${error}`));
      });
}

export default Projects;
